import './App.css';

function SiteHeader() {
  return (
    <div className="container-fluid header">
      <div className="row pt-3 pb-2 justify-content-center align-items-center">
        <div className="col-lg-2">
          <p className="header-title">Ben Smith</p>
        </div>
        <div className="col-lg-4">
          <p className="header-subtitle mb-0">Theatre Sound Engineer and Designer</p>
          <p className="header-subtitle text-start"><small>(He/him)</small></p>
        </div>
      </div>
    </div>
  );
}

export default SiteHeader;
